export default (function(a,b,c,d,e,f,g,h){return {data:{Zlo3iYberq:{data:{id:2126,attributes:{imdbId:"tt0069113",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYmM0ZDRkZGEtNTFmNS00MDg1LThkNWItZmU1NmM1OGM0NTU4L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.1\u002F10"},{Source:"Rotten Tomatoes",Value:"80%"},{Source:"Metacritic",Value:"70\u002F100"}],item_lang:{data:{id:2789,attributes:{title:d,plot:"A passenger ship, on her way to the scrap yard is pushed to her limits by the new owners to save on the dismantling fees. A tidal wave hits her, flipping her over so that all the internal rooms are upside down. A priest takes a mixed band of survivors on a journey through the bowels of the ship in an attempt to survive.",slug:"the-poseidon-adventure"}}},books:{data:[{id:10507,attributes:{title:d,description:e,thumbnail:f,authors:[b],firstBook:true,published:g,publisher:h,subtitle:a}},{id:10508,attributes:{title:d,description:e,thumbnail:f,authors:[b],firstBook:c,published:g,publisher:h,subtitle:a}},{id:10509,attributes:{title:"Beyond the Poseidon Adventure",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DHE-wVfQv5wC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1979-04-01",publisher:"Dell Publishing Company",subtitle:a}},{id:10510,attributes:{title:"Poseidon Adventure",description:a,thumbnail:a,authors:[b],firstBook:c,published:"1976-01-01",publisher:a,subtitle:a}},{id:10511,attributes:{title:"Snow Goose",description:"The moving wartime story of friendship and heroism, set against the dramatic backdrop of the World War II Battle of Dunkirk In the marshes of Essex, one of the last wild places left in England, a disfigured artist lives alone in an abandoned lighthouse. Shunned by society, he spends his days painting scenes of the coast and the birds that migrate to the meadowlands every winter. His days are solitary until one November afternoon, a young girl from a nearby village comes to his door carrying a wounded snow goose in her arms. The unlikely pair develop a friendship that deepens over the ensuing years, waiting together for the arrival of the birds every autumn. In 1940, with England at war, the birds depart early from the shores. The man, too, is called away by his duty as an Englishman to help evacuate the soldiers stranded on the beaches of Dunkirk. A moving tale of love, war, bravery, and sacrifice.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=X4OlKGGqo9oC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2011-03-30",publisher:"Knopf",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940939954}}("","Paul Gallico",null,"The Poseidon Adventure","The high-octane thriller that inspired the Academy Award–winning film: On a sinking cruise ship, passengers fight rising water—and each other—to survive. On its maiden voyage, luxury ocean liner SS Poseidon is capsized by a massive undersea earthquake. A handful of survivors must fight for their lives—struggling to make it from the upper deck of the ship to the hull, the only part above water, before the ship sinks. Faced with rising water and the violence of desperate passengers and crewmembers, the group must do everything it can to survive—before time runs out. Adapted into an award-winning film by Irwin Allen, The Poseidon Adventure is a thrilling tale with timeless suspense and excitement.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-2lsDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2014-05-16","Rosetta Books"))